import { createBrowserRouter } from "react-router-dom";
import BlankLayout from "../Pages/BlankLayout";
import DefaultLayout from "../Pages/DefaultLayout";
import routes from "../Router/routes";

// Apply layouts based on the `layout` property in the route configuration
const finalRoutes = routes.map((route) => {
  const Layout = routes.layout === "blank" ? BlankLayout : DefaultLayout;

  return {
    ...routes,
    element: <Layout>{routes.element}</Layout>,
  };
});

const router = createBrowserRouter(finalRoutes);

export default router;
